q($,"asI","a4g",function(){var p="ab",o="12:00 pm",n=null,m="assets/neptune.png",l=t.i
return H.b([N.jE(p,"Zipping around the sun in only 88 days, Mercury is the closest planet to the sun, and it's also the smallest, only a little bit larger than Earth's moon. Because its so close to the sun (about two-fifths the distance between Earth and the sun), Mercury experiences dramatic changes in its day and night temperatures: Day temperatures can reach a scorching 840  F (450 C), which is hot enough to melt lead. Meanwhile on the night side, temperatures drop to minus 290 F (minus 180 C).","assets/mercury.png",H.b(["data:image/png;base64,","https://cdn.pixabay.com/photo/2014/07/01/11/38/planet-381127_1280.jpg","https://cdn.pixabay.com/photo/2015/06/26/18/48/mercury-822825_1280.png","https://image.shutterstock.com/image-illustration/mercury-high-resolution-images-presents-600w-367615301.jpg"],l),"Mercury",o),N.jE(p,"The second planet from the sun, Venus is Earth's twin in size. Radar images beneath its atmosphere reveal that its surface has various mountains and volcanoes. But beyond that, the two planets couldn't be more different. Because of its thick, toxic atmosphere that's made of sulfuric acid clouds, Venus is an extreme example of the greenhouse effect. It's scorching-hot, even hotter than Mercury. The average temperature on Venus' surface is 900 F (465 C). At 92 bar, the pressure at the surface would crush and kill you. And oddly, Venus spins slowly from east to west, the opposite direction of most of the other planets.","assets/venus.png",H.b(["https://cdn.pixabay.com/photo/2011/12/13/14/39/venus-11022_1280.jpg","https://image.shutterstock.com/image-photo/solar-system-venus-second-planet-600w-515581927.jpg"],l),"Venus",n),N.jE(p,"The third planet from the sun, Earth is a waterworld, with two-thirds of the planet covered by ocean. It's the only world known to harbor life. Earth's atmosphere is rich in nitrogen and oxygen. Earth's surface rotates about its axis at 1,532 feet per second (467 meters per second) \u2014 slightly more than 1,000 mph (1,600 kph) \u2014 at the equator. The planet zips around the sun at more than 18 miles per second (29 km per second).","assets/earth.png",H.b(["https://cdn.pixabay.com/photo/2011/12/13/14/31/earth-11015_1280.jpg","https://cdn.pixabay.com/photo/2011/12/14/12/11/astronaut-11080_1280.jpg","https://cdn.pixabay.com/photo/2016/01/19/17/29/earth-1149733_1280.jpg","https://image.shutterstock.com/image-photo/3d-render-planet-earth-viewed-600w-1069251782.jpg"],l),"Earth",n),N.jE(p,"The fourth planet from the sun is Mars, and it's a cold, desert-like place covered in dust. This dust is made of iron oxides, giving the planet its iconic red hue. Mars shares similarities with Earth: It is rocky, has mountains, valleys and canyons, and storm systems ranging from localized tornado-like dust devils to planet-engulfing dust storms. ","assets/mars.png",H.b([],l),"Mars",n),N.jE(p,"The fifth planet from the sun, Jupiter is a giant gas world that is the most massive planet in our solar system \u2014 more than twice as massive as all the other planets combined, according to NASA. Its swirling clouds are colorful due to different types of trace gases. And a major feature in its swirling clouds is the Great Red Spot, a giant storm more than 10,000 miles wide. It has raged at more than 400 mph for the last 150 years, at least. Jupiter has a strong magnetic field, and with 75 moons, it looks a bit like a miniature solar system.","assets/jupiter.png",H.b([],l),"Jupiter",n),N.jE(p,"The sixth planet from the sun, Saturn is known most for its rings. When polymath Galileo Galilei first studied Saturn in the early 1600s, he thought it was an object with three parts: a planet and two large moons on either side. Not knowing he was seeing a planet with rings, the stumped astronomer entered a small drawing \u2014 a symbol with one large circle and two smaller ones \u2014 in his notebook, as a noun in a sentence describing his discovery. More than 40 years later, Christiaan Huygens proposed that they were rings. The rings are made of ice and rock and scientists are not yet sure how they formed. The gaseous planet is mostly hydrogen and helium and has numerous moons.","assets/saturn.png",H.b([],l),"Saturn",n),N.jE(p,"The seventh planet from the sun, Uranus is an oddball. It has clouds made of hydrogen sulfide, the same chemical that makes rotten eggs smell so foul. It rotates from east to west like Venus. But unlike Venus or any other planet, its equator is nearly at right angles to its orbit \u2014 it basically orbits on its side. Astronomers believe an object twice the size of Earth collided with Uranus roughly 4 billion years ago, causing Uranus to tilt. That tilt causes extreme seasons that last 20-plus years, and the sun beats down on one pole or the other for 84 Earth-years at a time. ","assets/uranus.png",H.b([],l),"Uranus",n),N.jE(p,"The eighth planet from the sun, Neptune is about the size of Uranus and is known for supersonic strong winds. Neptune is far out and cold. The planet is more than 30 times as far from the sun as Earth. Neptune was the first planet predicted to exist by using math, before it was visually detected. Irregularities in the orbit of Uranus led French astronomer Alexis Bouvard to suggest some other planet might be exerting a gravitational tug. German astronomer Johann Galle used calculations to help find Neptune in a telescope. Neptune is about 17 times as massive as Earth and has a rocky core.",m,H.b([],l),"Neptune",n),N.jE("kapil","The eighth planet\n from the sun, Neptune is about\n the size of Uranus and is known for supersonic strong\n winds. Neptune is far out and cold. The planet is more than 30 times as far from the sun as\n Earth. Neptune was the first planet predicted to exist by using ma\nth, before it was visually detected. ",m,H.b([],l),"Neptune",o)],H.S("p<BM*>"))})
